cation\\\/352086\"}],\"collection\":[{\"href\":\"https:\\\/\\\/www.wpbeaverbuilder.com\\\/wp-json\\\/wp\\\/v2\\\/fl_notification\"}],\"about\":[{\"href\":\"https:\\\/\\\/www.wpbeaverbuilder.com\\\/wp-json\\\/wp\\\/v2\\\/types\\\/fl_notification\"}],\"wp:attachment\":[{\"href\":\"https:\\\/\\\/www.wpbeaverbuilder.com\\\/wp-json\\\/wp\\\/v2\\\/media?parent=352086\"}],\"curies\":[{\"name\":\"wp\",\"href\":\"https:\\\/\\\/api.w.org\\\/{rel}\",\"templated\":true}]}},{\"id\":347444,\"date\":\"2018-04-04T16:27:13\",\"date_gmt\":\"2018-04-04T23:27:13\",\"guid\":{\"rendered\":\"https:\\\/\\\/www.wpbeaverbuilder.com\\\/?post_type=fl_notification&#038;p=347444\"},\"modified\":\"2018-04-04T16:27:13\",\"modified_gmt\":\"2018-04-04T23:27:13\",\"slug\":\"beaver-builder-2-1-redridge\",\"status\":\"publish\",\"type\":\"fl_notification\",\"link\":\"https:\\\/\\\/www.wpbeaverbuilder.com\\\/?fl_notification=beaver-builder-2-1-redridge\",\"title\":{\"rendered\":\"Beaver Builder 2.1 &#8220;Redridge&#8221;\"},\"content\":{\"rendered\":\"<p><img class=\\\"aligncenter size-full wp-image-347445\\\" src=\\\"https:\\\/\\\/www.wpbeaverbuilder.com\\\/wp-content\\\/uploads\\\/2018\\\/04\\\/redridge-notification-normal.jpg\\\" alt=\\\"\\\" width=\\\"318\\\" height=\\\"139\\\" srcset=\\\"https:\\\/\\\/www.wpbeaverbuilder.com\\\/wp-content\\\/uploads\\\/2018\\\/04\\\/redridge-notification-normal.jpg 318w, https:\\\/\\\/www.wpbeaverbuilder.com\\\/wp-content\\\/uploads\\\/2018\\\/04\\\/redridge-notification-normal-300x131.jpg 300w\\\" sizes=\\\"(max-width: 318px) 100vw, 318px\\\" \\\/><\\\/p>\\n<p>Beaver Builder 2.1 &#8220;Redridge&#8221; introduces a TON of new features and workflow improvements. If you're reading this, our new notification center here is one of them! Redridge also brings inline editing, saved columns, Gutenberg support, code validation, and a whole lot more. Click here to check out our release post and learn about all the new goodies.<\\\/p>\\n\",\"protected\":false},\"template\":\"