	>{{data.value}}</textarea>
</div>
</script><script type="text/html" id="tmpl-fl-builder-field-color"><div class="fl-color-picker<# if ( data.field.className ) { #> {{data.field.className}}<# } if ( data.field.show_reset ) { #> fl-color-picker-has-reset<# } #>">
